import React , {useEffect} from 'react'
import {List , Header} from 'semantic-ui-react'
export const Workers =({workers}) => {

    return (
        
        <div className='workers'>
            <h1>Workers </h1>
            <List>
            {Workers.map(worker=>{
                return (
                    <List.Item key={worker.name}>
                        <Header>{worker.name}</Header>
                        </List.Item>
                )
            })}

           </List>
        </div>
    )
}

export default Workers
